! function(document, window, $) {
    "use strict";
    var Site = window.Site;
    $(document).ready(function($) {
        Site.run()
    }),


        function() {
            var defaults = $.components.getDefaults("wizard"),
                options = $.extend(!0, {}, defaults, {
                    step: "> .nav > li > a",
                    onBeforeShow: function(step) {
                        step.$element.tab("show")
                    },
                    classes: {
                        step: {
                            error: "color-error"
                        }
                    },
                    onFinish: function() {
                        alert("finish")
                    },
                    buttonsAppendTo: ".tab-content"
                });
            $("#add_practice_tab").wizard(options)
        }(),
        function() {
            var defaults = $.components.getDefaults("wizard"),
                options = $.extend(!0, {}, defaults, {
                    onInit: function() {
                        $("#exampleFormContainer").formValidation({
                            framework: "bootstrap",
                            fields: {
                                username: {
                                    validators: {
                                        notEmpty: {
                                            message: "The username is required"
                                        }
                                    }
                                },
                                password: {
                                    validators: {
                                        notEmpty: {
                                            message: "The password is required"
                                        }
                                    }
                                },
                                number: {
                                    validators: {
                                        notEmpty: {
                                            message: "The credit card number is not valid"
                                        }
                                    }
                                },
                                cvv: {
                                    validators: {
                                        notEmpty: {
                                            message: "The CVV number is required"
                                        }
                                    }
                                }
                            }
                        })
                    },
                    validator: function() {
                        var fv = $("#exampleFormContainer").data("formValidation"),
                            $this = $(this);
                        fv.validateContainer($this);
                        var isValidStep = fv.isValidContainer($this);
                        return isValidStep === !1 || null === isValidStep ? !1 : !0
                    },
                    onFinish: function() {},
                    buttonsAppendTo: ".panel-body"
                });
            $("#agreedservices_js").wizard(options)
        }()
}(document, window, jQuery);